(76598, 305037, 0, 1, '【愛米樂團】我有 一個夢.wav', '', '2014-01-01 00:00:00', 2000, 19, 2, 1, '【愛米樂團】 我有一個夢\n\n詞:孟楷&順皓  曲:孟楷  編曲:愛米樂團\n\n我有一個夢  揹著吉他到處走\n太陽和天空  總是鼓勵我\n曾有人告訴我  有夢就追求\n不要後悔 在以後\n\n我有一個夢  帶著理想往前衝\n也許會受挫  影響不了我\n曾有人告訴我  堅持到最後\n不要中途  就失落\n\n手牽手一起走  心連心的感動\n未來的理想和目標  你和我\n\n難過的時候  就換個念頭\n我在你身後  一直為你守候\n不要想太多  就勇敢去追求  那個夢\n\n悲傷的時候  就望向天空\n我在你身後 一直為你加油\n跟著感覺走  就奔向那盡頭\n因為我有一個夢', '', 384, '', '', '', '', '陳志堅', '', 0, 1, 0, '2014-06-15 19:47:34', '2015-03-12 14:07:29', '0000-00-00 00:00:00'),
(76599, 305037, 0, 1, '【愛米樂團】田中這所在.wav', '', '2013-01-01 00:00:00', 2000, 19, 2, 1, ' 【愛米樂團】田中這所在   詞:煒凡&志堅   曲:孟楷\n\nA\n在我心中 它是美麗的故鄉 田中這哩所在 有出好米 甲好a子弟\n在我心中 那個美麗的故鄉 田中這哩所在 有你甲我 牽手來做伙\n\n不管你在哪 遇到甚麼問題 不用歹勢 轉來田中坐\n\nB\n微風輕輕吹 無論你在哪 田中這哩所在 你就要記著\n若是走不落 請你轉頭看 田中這哩所在 甲你來相陪\n\nRAP  \n在我心中 它是最美的故鄉     田中\n風景秀麗 山明水秀 最適合辦  馬拉松\n金黃色的稻田 綠油油稻葉\n撲鼻而來稻香 彷彿置身在    幻想的世界\n美麗橙色夕陽  緩緩滑落地面\n那一刻 落入地平線 它感覺     真美  \n\n田中ㄟ一切     價阮龍有關係\n因為挖系田中郎 熱愛這片土地\n田中ㄟ一切     價阮龍有關係\n因為挖系田中郎 熱愛這片土地', '', 322, '', '', '', '', '陳志堅', '', 0, 1, 0, '2014-06-15 19:50:05', '2015-03-12 14:07:29', '0000-00-00 00:00:00'),
