(76619, 182348, 0, 1, '英勇的淚水', '', '2013-06-15 00:00:00', 2000, 19, 1, 7, '英勇的淚水 不停落下\n何等的憤怒 你曾經遺忘 \n\n你看 你看\n年輕的魂在亂世裡奔馳 \n他堅持   \n\n英勇的淚水 不停落下\n何等的憤怒 你曾經遺忘\n眾人的目光 無所畏懼\n儘管斥責再無理 他絕不放棄\n\n在你身上 我們看見希望\n點燃真實的渴望 朝氣蓬勃的光芒 \n在你身上 我們看見希望\n孤身對抗 \n我們在這唱 \n\n面對那些 從未認真過的污穢\n你總是勇敢面對一切\n\n年輕的魂  \n亂世裡奔馳 \n英勇的淚水不停落下   \n\n那些無法無天的盲目之民\n還真自以為聰明 我只能說你\n早已被黑暗蒙蔽\n\n年輕的魂在亂世裡奔馳 \n不停堅持 不停奔馳   \n年輕的魂在亂世裡奔馳 \n不停堅持\n無所畏懼', '', 302, '', '', '', '', '彼岸曙光', '', 0, 1, 1, '2014-06-16 16:55:42', '2014-07-21 01:02:54', '2014-07-21 01:02:54'),
