(76634, 165273, 6741, 4, '我是誰', '從外表到內心自我探索的過程，敘述現代人不管是從任何的角度都在自我探索的問題—我是誰?', '2014-04-26 00:00:00', 2000, 19, 1, 4, '叫醒我\n讓我不要在這樣胡鬧的世界\n隨波逐流\n浮浮沉沉\n在我沒把握不會溺斃的時候\n別讓我墜落\n\n張開雙手不夠\n鬆綁了我的手\n走到十字路口\n別叫我再回頭\n\nHEY 我是誰\n不要把我留在這畫面\n找不到出口那天\n原來猙獰的是我的臉\n', '', 238, '', '大頭', '大頭', '重擊者', '重擊者', '', 0, 1, 0, '2014-06-17 12:55:09', '2015-03-12 14:07:30', '0000-00-00 00:00:00'),
