(76688, 40677, 6938, 4, '少年夢 Youth Dream', '', '2014-06-02 00:00:00', 2000, 30, 0, 8, '', '少年夢\n\n站在人來人往的車站 看著火車緩緩駛過\n心中的慌忙 眼中的失落\n坐在車上上頭看到鐵枝路的電報條\n一枝 一枝閃過\n頂頭的性命 拼命的前途\n\n當然會驚惶 \n但是應該要把咱的理想 乎大家知影\n遮就是咱做的夢\n你有感到咱的意念否\n\n當然會驚惶 \n但是應該要把咱的理想 乎大家知影\n遮就是咱做的夢\n你有感到咱的意念否\n\n很久以前 乎人當作起痟的暝夢\n任人笑虧 這乾是少年的輕狂\n等咱都有年歲之後 再從頭來看過這全部\n都有做完否 甘有後悔否\n\n當然會驚惶 \n但是應該要把咱的理想 乎大家知影\n遮就是咱做的夢\n你有感到咱的意念否\n\n當然會驚惶 \n但是應該要把咱的理想 乎大家知影\n遮就是咱做的夢\n你有感到咱的意念否', 370, '', '', '', '', 'White Wabbit Records 小白兔唱片', '', 1, 1, 0, '2014-06-18 19:20:21', '2015-03-12 14:07:32', '0000-00-00 00:00:00'),
