(76718, 305670, 0, 1, '興奮馬樂團  Winter Life', '', '2014-06-13 00:00:00', 2000, 19, 1, 10, 'Winter life 詞曲:吳昱杰\n\n活了19年來從沒看過雪 也沒仔細想過生活的真正意義\n微笑外套掛在泛黃的皮椅 越想去改變 越是頹廢\n\n冬天 來臨 寒風 直吹\n\n生活其實沒有那麼多問題\n管他夏天冬天認真過就對\n我們總是害怕做改變\n偶爾裝笨嚐試有什麼不對\n\n冬天的微風 吹起了裙襬 大衣底下的美 讓人覺得好奇\n天空煙花綻放的美麗節慶 快不快樂 平凡的冷\n\n冬天 來臨 寒風 直吹\n\n生活其實沒有那麼多問題\n管他夏天冬天認真過就對\n我們總是害怕做改變\n偶爾裝笨嚐試有什麼不對', '', 208, '', '吳昱杰', '吳昱杰', '', '吳昱杰', '', 0, 1, 0, '2014-06-19 02:11:46', '2015-03-12 14:07:33', '0000-00-00 00:00:00'),
(76719, 305670, 0, 1, '興奮馬樂團 離開原點', '', '2014-06-13 00:00:00', 2000, 19, 1, 1, '離開原點 詞:吳昱杰 曲:邱耿偉\n\n在零跟一之間徘迴 眼神有些無奈\n被現實綑綁和阻礙 我跳脫不開\n從前太多的依賴 使我不明白\n\n這世界 太少明白 你我的最愛\n不能保護的寵愛 笑著哭著痛起來\n也許是 隱藏悲哀 才有勇氣去看待\n就在此刻 leaving away\n\n在放空摸索這感慨 心裡有著期待\n正視自己的失敗 就放眼未來\n從前太多的依賴 使我不明白\n這是原點的墮怠 用力離開\n\n這世界 太少明白 你我的最愛\n不能保護的寵愛 笑著哭著痛起來\n也許是 隱藏悲哀 才有勇氣去看待\n就在此刻 leaving away', '', 229, '', '邱耿偉', '吳昱杰', '', '吳昱杰', '', 0, 1, 0, '2014-06-19 02:15:24', '2015-03-12 14:07:33', '0000-00-00 00:00:00'),
(76720, 305670, 0, 1, '興奮馬樂團 地下情人', '', '2014-06-12 00:00:00', 2000, 19, 1, 10, '地下情人 詞曲:吳昱杰\n\n就是一種沒有太陽的生活\n開心難過都不過娛樂大眾\n幸福美夢出現在誰的眼中\n諷刺的是愛是單方面的求\n\n打開音響聽著戀愛的節奏\n聽著哼著卻難掩此種落寞\n銅牆鐵壁蠻狠的包圍著我\n多想見你做你的特別朋友\n\n反反覆覆 說走就走 痛苦愧疚隱藏在誰的心中\n十分要命的感受 不具名的疼痛\n\nHEY~這是一種無能的軟弱\nHEY~誰都不該保持著沉默\nHEY~誰和誰在拉扯著雙手\nHEY~這就是一個錯 徹徹底底悲哀的錯\n\n喝著啤酒晃蕩了三個鐘頭\n熄掉菸頭做我的春秋大夢\n夢裡夢外忘不掉你的面容\n誰在等我做我的特別朋友\n\n心動心痛 別再折磨\n誰不想說 誰讓誰在意過\n我不自由我沉默 我為了誰而走\n\nHEY~這是一種無能的軟弱\nHEY~誰都不該保持著沉默\nHEY~誰和誰在拉扯著雙手\nHEY~這就是一個錯 徹徹底底悲哀的錯\n\nHEY~這有點疼痛也有點難過\nHEY~這早就知道不會有結果\nHEY~good bye my love\nHEY~', '', 291, '', '吳昱杰', '吳昱杰', '', '吳昱杰', '', 0, 1, 0, '2014-06-19 02:19:45', '2015-03-12 14:07:33', '0000-00-00 00:00:00'),
