(76734, 60397, 0, 1, '碎碎念(new demo)', '', '2014-06-19 00:00:00', 2000, 19, 2, 1, '閉嘴\n不要再碎碎念\n我就快要崩潰\n請你不要靠杯\n請你給我閉嘴\n\n帶著渾身的酒味\n躡手躡腳回房間\n脫下襪子閉上眼\n喔不這是洗手間\n\n我的面前忽然出現\n一張熟悉的臉\n他的聲音出現\n讓我頭痛欲裂\n\n閉嘴\n不要再碎碎念\n我就快要崩潰\n請你不要靠杯\n請你給我\n', '', 179, '', '', '', '', '三十萬年老虎鉗', '', 1, 1, 0, '2014-06-19 21:43:53', '2015-03-12 14:07:33', '0000-00-00 00:00:00'),
(76735, 60397, 0, 1, 'She''s Already Mine(new demo)', '', '2014-06-17 00:00:00', 2000, 19, 2, 1, '這個美妹走在路上屁股晃得很美\n屁股下面還有一雙很修長的腿\n短短的裙子配上高跟鞋\n路上的男人都對他流口水\n每個人都不停的放電\n但是他卻不看一眼\n\n\n旁邊一個五十幾歲大叔被拒絕\n長的不帥又沒有錢根本沒有機會\n一個西裝筆挺的年輕人正要上前\n秀出他有如金城武的笑臉\n我走過去搭上那美女的肩\n對他說聲抱歉\n\n"She''s already mine"\n你根本沒機會\n"She''s already mine"\n我比你帥一百倍\n"She''s already mine"\n這長腿的辣妹\n"She''s already mine"\n我回家好好品味\n\n朋友都問怎麼砲道這個妹\n說我沒有腹肌只有吃肥的臉\n衣服也穿得不適很有品味\n我說只要一點手腕就OK\n\n"She''s already mine"\n你根本沒機會\n"She''s already mine"\n我比你帥一百倍\n"She''s already mine"\n這長腿的辣妹\n"She''s already mine"\n我回家好好品味\n\noo~that''s it girl\nyeah~that''s the spot\ncome on come on\nnow hit it!!\n\n"She''s already mine"\n你根本沒有機會\n"She''s already mine"\n我比你帥一百倍\n"She''s already mine"\n這長腿的辣妹\n"She''s already mine"\n我回家好好品味\n', '', 265, '', '', '', '', '三十萬年老虎鉗', '', 1, 0, 0, '2014-06-19 21:44:22', '2015-03-12 14:07:33', '0000-00-00 00:00:00'),
(76736, 60397, 0, 1, 'Summer Time(不插電版本)', '', '2014-06-19 00:00:00', 2000, 19, 2, 1, 'summer time,\ni can hear you missing for my smile\nso close your eyes\nafter a while i''ll be back your side\n\nsummer time,\ni can smell your skin waiting my arrive\njust wait a while\ni''m heading home and i will make you high\n\njust remeber those words i told you\nall the pretty things i promise you\nso leave the worries behind you\njust remeber that i love you\n\nafter tonight i will fall from the sky\ncause i''ve seen the heaven but i wanna by your side\nand your pretty face can make those angels cry\ni''ll be right back\nafter this summer time\n\nsummer time\ni can see your face every night\njust your laugh\ni wish i can hear it any time\n\ni remeber every joke you told\nevery night we sleep in cuddles\nso leave the worries behind you\njust remeber that i love you\n\nafter tonight i will fall from the sky\ncause i''ve seen the heaven but i wanna by your side\nand your pretty face can make those angels cry\ni''ll be right back\nafter summer time\n\nand even though this distance seems can kill evrey couples\nbut it''s not strong enough to break us too\nthough future seems to cover by strom but i know we will make it through\ncause our love is true\n\nafter tonight i will fall from the sky\ncause i''ve seen the heaven but i wanna by your side\nand your pretty face can make those angels cry\ni''ll be right back\ni''ll be right back\n\nthis summer time \nthis summer time\nwait till the end of this summer time\ni''ll be right back\nafter summer time\n\nthis summer time \nthis summer time\nafter this summer time \n', '', 348, '', '', '', '', '三十萬年老虎鉗', '', 1, 1, 0, '2014-06-19 21:49:15', '2015-03-12 14:07:33', '0000-00-00 00:00:00'),
