(76738, 68306, 0, 1, '旅程 Journey', '人生就像一場旅行..\n\n遇見不一樣的風景，不一樣的人..\n\n而海邊是一個可以讓一切事物和心靈沈澱的地方\n\n我們在那，找到了自己', '2014-06-19 00:00:00', 2000, 30, 0, 7, '', '', 222, '', '張子霽/劉光桓', '', '張子霽', '張子霽 a.k.a 強尼的烏克麗麗', '', 0, 1, 0, '2014-06-19 23:49:25', '2015-03-12 14:07:34', '0000-00-00 00:00:00'),
(76739, 128942, 0, 1, '2014春天吶喊Dirty_set', '在都市叢林中靜靜的走著,遠方隱約透過夾縫中射出的一點光線,將自己照醒\n巨大的破裂聲,眼前已是一片的慘不忍睹,下腹部不段的劇痛\n一點點骯髒鮮紅潔淨的鮮血,像是眼淚般.躺在眼眶旁繞著眼睛旋轉!\n人群排列組合的躺下,像是骨牌效應!\n壓倒彼此的竟是那看似美麗的金銀白鈔!\n緊閉雙唇用力的呼吸\n是髒空氣不斷低灌入體內,腦部也反應變化,於是張開雙眼\n鏡中反射出骯髒的輪廓....\n原來..\n\nI am a Dirty boy~\n\n', '2014-06-20 00:00:00', 2000, 19, 2, 3, '', '', 2199, '', '', '', 'Dirty Boy', 'Dirty Boy', '', 0, 1, 0, '2014-06-20 03:20:54', '2015-03-12 14:07:34', '0000-00-00 00:00:00');
